from html2image import Html2Image
from PIL import Image


def make_png_id_bangla(classroll, bordroll, rag_number):
    # back page html
    back_sid = '''
    <!DOCTYPE html>
    <html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <link href="https://fonts.maateen.me/kalpurush/font.css" rel="stylesheet">
    <style>
    *
            {
                margin:00px;
                padding: 00px;

            }

            .container2
            {
                height: 100vh;
                width: 100%;
                display: flex;
                align-items: center;
                justify-content: space-around;
                flex-wrap: wrap;
                box-sizing: border-box;
                flex-direction: row;



            }

            .font2
            {

                height: 800px;
                width:500px;
                position: relative;
                border-radius:10px;
                background-image:url('data:image/png;base64,');
                background-size: 500px 800px;
                background-repeat: no-repeat;
            }



            .tab {padding-right:30px;}

            .Back_detail
            {
                position: absolute;
                top: 40px;
                line-height: 25px;
                left: 145px;
                text-transform:capitalize;
                font-family: 'Kalpurush', sans-serif;
                font-size: 20px;
                text-emphasis: spacing;
                margin-left: 4px;
            }


        </style>
        <title>Back side</title>

    </head>
    <body>

        <!-- Back sid of this id -->
        <div class="container2">
            <div class="font2">
                    <div class="Back_detail">
                        <b>
                        <P>ক্লাস রোল : @ClassRoll</P>
                        <p>বোর্ড রোল : @Bord_roll</p>
                        <p>রেজিঃ নম্বর : @Rag_num</p>
                    </b>
            </div>

        </div>

        </div>
    </body>
    </html>
'''
    back_sid = back_sid.replace("@ClassRoll", str(classroll))
    back_sid = back_sid.replace("@Bord_roll", str(bordroll))
    back_sid = back_sid.replace("@Rag_num", str(rag_number))
    # Output image path
    output_image_path_png = f"Id Card/back_{bordroll}.png"
    output_image_path_pdf = f"Id Card/back_{bordroll}.pdf"

    # Convert HTML to image
    hti = Html2Image()
    image_path_png = hti.screenshot(html_str=back_sid)[0]
    image_path_pdf = hti.screenshot(html_str=back_sid)[0]

    # Load the image using Pillow
    image_png = Image.open(image_path_png)
    image_pdf = Image.open(image_path_pdf)

    # Save the image
    image_png.save(output_image_path_png, quality=100)
    # image_pdf.save(output_image_path_pdf, quality=100)


